          <Grid item xs={12}>
          </Grid>
          <Grid item s={12}>
            <BGHeader></BGHeader>
            <SideBar />
          </Grid>
          <Grid item s={6}>
           <SignIn />
          </Grid>
          <Grid item s={6}>

          </Grid>
          <Grid item s={6}>
            <gameButtons></gameButtons>
          </Grid>
          <Grid item s={6}>

          </Grid>
        </Grid>
      </div>
    </div>
  );
}
